import React from 'react';

const Youtube = ({ videoId }) => {
  return (
    <div>
      <iframe
        title="YouTube Video"
        width="560"
        height="315"
        src={`https://www.youtube.com/embed/${videoId}`}
        frameBorder="0"
        allow="autoplay; encrypted-media"
        allowFullScreen
      />
    </div>
  );
};

export default Youtube;
